import React, { Component } from 'react';

//css
import './Admin.css';

class Admin extends Component {
  render() {
    return (
      <div className="Admin">
        <div className="color">
          <h1 className="title">Administrador</h1>
        </div>
      </div>
    );
  }
}

export default Admin;
